	(1, 1, 'من نحن', 'من-نحن', '<p class=\\"\\\\\\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"MsoNormal\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\\\\"\\" dir=\\"\\\\\\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"RTL\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\\\\"\\" rtl;=\\"\\" text-align:=\\"\\" justify;\\\\\\"=\\"\\" line-height:16.8pt\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"=\\"\\\\\\"\\\\\\"\\" style=\\"text-align: justify; direction: rtl; font-size: 13.3333px;\\"><span style=\\"font-family: \\\'\\\\\\\\\\\\\\\\\\\\\\\\\\"Helvetica\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\', \\\'\\\\\\\\\\\\\\\\\\\\\\\\\\"sans-serif\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\';\\">جمعية دوت كوم</span></p><p class=\\"\\\\\\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"MsoNormal\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\\\\"\\" dir=\\"\\\\\\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"RTL\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\\\\"\\" rtl;=\\"\\" text-align:=\\"\\" justify;\\\\\\"=\\"\\" line-height:16.8pt\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"=\\"\\\\\\"\\\\\\"\\" style=\\"font-family: Arial, Verdana; text-align: justify; direction: rtl; font-size: 13.3333px;\\"><span lang=\\"\\\\\\"\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"AR-SA\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\\\\"\\" mso-fareast-font-family:\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"times=\\"\\\\\\"\\\\\\"\\" new=\\"\\\\\\"\\\\\\"\\" roman\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\";color:#414a51\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\"=\\"\\\\\\"\\\\\\"\\" style=\\"font-family: \\\'\\\\\\\\\\\\\\\\\\\\\\\\\\"Helvetica\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\', \\\'\\\\\\\\\\\\\\\\\\\\\\\\\\"sans-serif\\\\\\\\\\\\\\\\\\\\\\\\\\"\\\';\\">عميلنا العزيز، نحن في جمعية دوت كوم للتجارة الإلكترونية نؤمن أن خدمة العملاء هي حجر الاساس في عملنا كله. فنحن نبذل قصارى جهدنا لتجنب أي مشاكل قد تحدث أثناء تجربة التسوق معنا، ولهذا فنحن حريصين على أن تكون كل سياساتنا شفافة وبسيطة، وإذا كنت بحاجة إلى أي توضيح فلا تتردد في الاتصال بنا مباشرة </span></p>', '', 'جمعية دوت كوم'),
	(1, 2, 'About Us', 'About-Us', '<p>The business world is no longer the same as it used to be 10 years ago. Nowadays the Internet is considered to be an ideal place to conduct business transactions and target large international customer audience. Since more and more people start looking for products online, ecommerce or electronic commerce involving buying / selling goods and services through the Internet has become a real source of income for thousands of small businesses and big corporations And because most of the online companies do not ship products outside their country .zajex.com Shop and Ship providing you with your own unique address in USA  then we  ship these products to your permanent residences, or to places where you wish to get the products at. Zajex.com is the best way to people who are unable to obtain their requests due to the sellers not shipping products outside their demography.Zajex.com is offers the best shipping rate .we consider our  customers looking for and expecting vibrant services and features like better tracking of shipments, online facilities, predictable and timely delivery and transparent billing and invoicing information</p>', '', 'pThe business world is no longer the same as it used to be 10 years ago. Nowadays the Internet is considered to be an ideal place to conduct business transactions and target large international custom'),
	(3, 1, 'شروط إستخدام الموقع', 'شروط-إستخدام-الموقع', '<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;"><font face="Tahoma">شروط إستخدام الموقع سياسة التوصيل و الارجاع عميلنا العزيز، نحن في جمعية دوت كوم للتجارة الإلكترونية نؤمن أن خدمة العملاء هي حجر الاساس في عملنا كله</font>.&nbsp;<font face="Tahoma">فنحن نبذل قصارى جهدنا لتجنب أي مشاكل قد تحدث أثناء تجربة التسوق معنا، ولهذا فنحن حريصين على أن تكون كل سياساتنا شفافة وبسيطة، وإذا كنت بحاجة إلى أي توضيح فلا تتردد في الاتصال بنا مباشرة</font>.&nbsp;<font face="Tahoma">سياسة الاستبدال او الارجاع لديك الحق بإستبدال أو إرجاع البضاعة المشتراه من جمعية دوت كوم ١٤ يوم من تاريخ الشراء في حالة وجوب الشروط الآتية</font>:</p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">1-&nbsp;<font face="Tahoma">أن تكون البضاعة المراد إسترجاعها أو إستبدالها بها خلل مصنعي لا يمكن إصلاحه بدون المساس بجودة البضاعة أو تكون البضاعة مغشوشة أو مقلدة أومعيبة أو غير مطابقة للمواصفات المذكورة على موقع جمعية دوت كوم</font>.</p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">2-&nbsp;<font face="Tahoma">أن تكون البضاعة بالكرتون وعلى نفس حالتها وقت الشراء مع كامل الإكسسوارات</font></p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">3-&nbsp;<font face="Tahoma">أن تكون البضاعه بحالة جيدة وقابلة للعرض&nbsp;</font>(<font face="Tahoma">عدا البضاعة التي وجد فيها خلل مصنعي أو مغشوشة أو مقلدة</font>)</p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">4-&nbsp;<font face="Tahoma">المواد الغذائية&nbsp;</font>(<font face="Tahoma">إلا إذا انتهت صلاحيتها في وقت التسليم</font>)&nbsp;<font face="Tahoma">والمنتجات الشخصية&nbsp;</font>(<font face="Tahoma">على سبيل المثال وليس الحصر، ألات إزالة الشعر والحلاقه وملابس السباحة والملابس الداخلية والصحف والمجلات ومنتجات النظافة وفرش الأسنان ومجففات الشعر الخ</font>)&nbsp;<font face="Tahoma">ليست مؤهلة للإسترجاع أو تبديل</font>. 2-&nbsp;<font face="Tahoma">لديك الحق عميلنا العزيز بإستلام ثمن البضاعة التي تم إسترجاعها بنفس الطريقة التي تم دفعها&nbsp;</font>3-&nbsp;<font face="Tahoma">لديك الحق عميلنا العزيز بإستلام ثمن البضاعة التي تم إسترجاعها بالكامل ، ولن تخصم أي نوع من الرسوم مثل رسوم بطاقة الفيزا او رسوم بطاقة الكي نت او ما شابه ذلك من المبلغ المسترجع</font>. 4-&nbsp;<font face="Tahoma">لديك الحق في أستلام ثمن البضاعة التي تم إسترجاعها خلال عشرة أيام من تاريخ قبول إسترجاع البضاعة&nbsp;</font>5-&nbsp;<font face="Tahoma">لديك الحق عميلنا العزيز بإستبدال البضاعة المشتراه خلال&nbsp;</font>14&nbsp;<font face="Tahoma">يوم من تاريخ الشراء على أن تكون البضاعة بالتغليف الأصلي وغير مستخدمة وبكامل إكسسواراتها ،ونقدم لك كوبون بقيمة البضاعة المستبدلة لشرائك أيه بضاعة من موقع جمعية دوت كوم</font>.&nbsp;<font face="Tahoma">طريقة إسترجاع أو إستبدال البضاعة&nbsp;</font>1-&nbsp;<font face="Tahoma">في حالة توافر شروط الإستبدال أو الإسترجاع إذا تم إتصالك علينا خلال يومين من تاريخ إستلامك المنتج سوف نقوم بإرسال مندوبنا لإستلام المنتج</font>. 2-&nbsp;<font face="Tahoma">إذا تم الإتصال بعد يومين يقوم العميل بتسليم المنتج إلى أحد فروع الخدمة المعتمدة&nbsp;</font>-&nbsp;<font face="Tahoma">لدى جمعية دوت كوم&nbsp;</font>3-&nbsp;<font face="Tahoma">سيتم تقييم طلب الاسترجاع والاستبدال خلال ١٠ أيام عمل من تاريخ استلام الطلب الكفالة&nbsp;</font>1-&nbsp;<font face="Tahoma">الكفالة متوفرة للبضاعة التي تم تحديد مدة كفالتها على صفحة المنتج على جمعية دوت كوم&nbsp;</font>2-&nbsp;<font face="Tahoma">للإستفادة من الكفالة يرجى تقديم أصل الفاتورة لمركز الصيانة المعتمد لمنتجك كما هو مبين أدناه&nbsp;</font>3-&nbsp;<font face="Tahoma">الكفالة لا تشمل الأعطال الناتجة عن سوء الأستخدام ،أو سوء التركيب ،أوعند الكسرأو عن عدم إنتظام التيار الكهربائى ، أو تعرض الجهاز لمواد سا ئله، وأى تصليح يتم خارج اشراف ورشة الشركه أوفيروسات الكمبيوتر&nbsp;</font>4-&nbsp;<font face="Tahoma">إذا كنت غير راضي عن أي مركز صيانة قمت بمراجعته للإستفادة من كفالة منتج قمت بشرائه من شركة جمعية يرجى التواصل مع قسم خدمة العملاء ونحن سنحرص كل الحرص على أن نقدم لك أفضل خدمة كما تستحق</font>.&nbsp;<font face="Tahoma">سياسة التوصيل</font></p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">1-&nbsp;<font face="Tahoma">سنقوم بتوصيل طلباتكم في الكويت من خلال اسطول الشركة، و من وقت الى الآخر سنقوم باستخدام شركات متخصصة لتوصيل تلك الطلبات</font>.</p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">2-&nbsp;<font face="Tahoma">سيتم توصيل الطلبات حسب طريقة التوصيل التي تختارها</font>.&nbsp;<font face="Tahoma">نوفر في جمعية طريقتين للشحن وهما التوصيل الفوري خلال&nbsp;</font>3&nbsp;<font face="Tahoma">ساعات والتوصيل في الاوقات المحددة اللتي تختارها اثناء عملية الشراء</font>.</p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">3-&nbsp;<font face="Tahoma">عندما يتم التوصيل سيطلب منك توقيعك إلكترونياً أو توقيعك على نسخة الفاتورة وهذا التوقيع يكون بمثابة تأكيد أنك إستلمت المنتجات كاملة كما هو مبين في الفاتورة</font>.</p>\r\n\r\n<p align="RIGHT" style="line-height: 20.8px; margin-bottom: 0in;">4-&nbsp;<font face="Tahoma">إن لم تكن متواجد في العنوان المحدد سنقوم بتسليم الطلب لأى شخص متواجد بهذا العنوان وتوقيعه على الفاتورة إلكترونياً أوعلى نسخة الفاتوره ، وعند توقيع أى شخص من الموجودين فى العنوان على طلب التوصيل يعتبر أن العميل قد استلم الأغراض الموجوده بالفاتوره&nbsp;</font>5-&nbsp;<font face="Tahoma">إذا تم الوصول الى العنوان المحدد من قبلك ولم نستطيع تسليم الطلب يرجى الإتصال بخدمة العملاء لتحديد موعد آخر لتوصيل الطلب</font>.&nbsp;<font face="Tahoma">الشركة غير مسؤولة عن أيه طلب لم يتم توصيله خلال شهر من تاريخ الطلب</font></p>\r\n', 'Convention on the site Terms of Use\r\nإتفاقية وشروط إستخدام موقع zajex.com', 'إتفاقية وشروط إستخدام'),
