لاتفاقية. هذه الاتفاقية (والتي تعدل بين حين وآخر بحسب بنودها) تضع كافة الخطوط العريضة للتفاهم والاتفاق بينك وبين موقع zajex.com مع الاعتبار لما يلي : -ليس من حق أي شخص لا يكون طرفاً في اتفاقية المستخدم هذه أن يفرض أية بنود أو شروط فيها. -إذا تمت ترجمة اتفاقية المستخدم لأي لغة أخرى غير الإنجليزية، سواء على الموقع أو بطرق أخرى، فإن النص الإنجليزي لها يظل هو السائد. &nbsp; اتفاقية المستخدم هذه محكومة ومصاغة بحسب قانون دولة الكويت ، وهي خاضعة تماماً وكلياً للتشريع المعمول به في المحاكم الكويتية، هذه الفقرة توجد بديلاً يتم اللجوء إليه في حال انتهاء مفعول اتفاقية المستخدم هذه أو الغاؤها لأي سبب كان. &nbsp; &nbsp;</p>\r\n', 'Convention on the site Terms of Use\r\nإتفاقية وشروط إستخدام موقع zajex.com', 'إتفاقية وشروط إستخدام موقع جمعية دوت كوم'),
	(4, 1, 'من نحن', 'من-نحن', '<p>جمعية دوت كوم</p>\r\n\r\n<p>&lt;span lang=&quot;\\&quot; \\\\\\\\\\\\\\&quot;ar-sa\\\\\\\\\\\\\\&quot;\\&quot;&quot;=&quot;&quot; mso-fareast-font-family:\\\\\\\\\\\\\\&quot;times=&quot;\\&quot; \\&quot;&quot;=&quot;&quot; new=&quot;\\&quot; roman\\\\\\\\\\\\\\&quot;;color:#414a51\\\\\\\\\\\\\\&quot;=&quot;\\&quot; style=&quot;font-family: &#39;\\\\\\\\\\\\&quot; helvetica\\\\\\\\\\\\&quot;&#39;,=&quot;&quot; &#39;\\\\\\\\\\\\&quot;sans-serif\\\\\\\\\\\\&quot;&#39;;&quot;=&quot;&quot;&gt;عميلنا العزيز، نحن في جمعية دوت كوم للتجارة الإلكترونية نؤمن أن خدمة العملاء هي حجر الاساس في عملنا كله. فنحن نبذل قصارى جهدنا لتجنب أي مشاكل قد تحدث أثناء تجربة التسوق معنا، ولهذا فنحن حريصين على أن تكون كل سياساتنا شفافة وبسيطة، وإذا كنت بحاجة إلى أي توضيح فلا تتردد في الاتصال بنا مباشرة&nbsp;</p>\r\n', '', 'جمعية دوت كوم'),
	(4, 2, 'About Us', 'About-Us', '<p>The business world is no longer the same as it used to be 10 years ago. Nowadays the Internet is considered to be an ideal place to conduct business transactions and target large international customer audience. Since more and more people start looking for products online, ecommerce or electronic commerce involving buying / selling goods and services through the Internet has become a real source of income for thousands of small businesses and big corporations And because most of the online companies do not ship products outside their country .zajex.com Shop and Ship providing you with your own unique address in USA &nbsp;then we &nbsp;ship these products to your permanent residences, or to places where you wish to get the products at. Zajex.com is the best way to people who are unable to obtain their requests due to the sellers not shipping products outside their demography.Zajex.com is offers the best shipping rate .we consider our &nbsp;customers looking for and expecting vibrant services and features like better tracking of shipments, online facilities, predictable and timely delivery and transparent billing and invoicing information</p>\r\n', '', 'pThe business world is no longer the same as it used to be 10 years ago. Nowadays the Internet is considered to be an ideal place to conduct business transactions and target large international custom');
